webpackJsonp([0x83fa77ab4b61],{6053:function(s,a){s.exports={data:{markdownRemark:{html:'<h2>Your first React App</h2>\n<h3>Installation</h3>\n<p>As specified in the previous artice (Installation), run the <code>Create React App</code> tool. After everything has finished, <code>cd</code> into the folder of your application and run <code>npm start</code>.\nThis will start a development server and you are all set to start developing your app!</p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code><span class="token function">npm</span> <span class="token function">install</span> -g react-create-app\ncreate-react-app my-first-app\n\n<span class="token function">cd</span> my-first-app\n<span class="token function">npm</span> start\n</code></pre>\n      </div>\n<h3>Editing the code</h3>\n<p>Start up your editor or IDE of choice and edit the <code>App.js</code> file in the <code>src</code> folder. When created with the <code>react-create-app</code> tool, there will already be some code in this file.</p>\n<p>The code will consist of these parts:</p>\n<h4>imports</h4>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token keyword">import</span> React<span class="token punctuation">,</span> <span class="token punctuation">{</span> Component <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'react\'</span><span class="token punctuation">;</span>\n<span class="token keyword">import</span> logo <span class="token keyword">from</span> <span class="token string">\'./logo.svg\'</span><span class="token punctuation">;</span>\n<span class="token keyword">import</span> <span class="token string">\'./App.css\'</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>This is used by <a href="https://webpack.js.org/">webpack</a> to import all required modules so that your code can use them. This code imports 3 modules:</p>\n<ol>\n<li><code>React</code> and <code>Component</code>, which allow us to use React as it should be used. (With components)</li>\n<li><code>logo</code>, which allows us to use <code>logo.svg</code> in this file.</li>\n<li><code>./App.css</code>, which imports the stylesheet for this file.</li>\n</ol>\n<h4>classes/components</h4>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token keyword">class</span> <span class="token class-name">App</span> <span class="token keyword">extends</span> <span class="token class-name">Component</span> <span class="token punctuation">{</span>\n  <span class="token function">render</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">return</span> <span class="token punctuation">(</span>\n      <span class="token operator">&lt;</span>div className<span class="token operator">=</span><span class="token string">"App"</span><span class="token operator">></span>\n        <span class="token operator">&lt;</span>header className<span class="token operator">=</span><span class="token string">"App-header"</span><span class="token operator">></span>\n          <span class="token operator">&lt;</span>img src<span class="token operator">=</span><span class="token punctuation">{</span>logo<span class="token punctuation">}</span> className<span class="token operator">=</span><span class="token string">"App-logo"</span> alt<span class="token operator">=</span><span class="token string">"logo"</span> <span class="token operator">/</span><span class="token operator">></span>\n          <span class="token operator">&lt;</span>h1 className<span class="token operator">=</span><span class="token string">"App-title"</span><span class="token operator">></span>Welcome to React<span class="token operator">&lt;</span><span class="token operator">/</span>h1<span class="token operator">></span>\n        <span class="token operator">&lt;</span><span class="token operator">/</span>header<span class="token operator">></span>\n        <span class="token operator">&lt;</span>p className<span class="token operator">=</span><span class="token string">"App-intro"</span><span class="token operator">></span>\n          To <span class="token keyword">get</span> started<span class="token punctuation">,</span> edit <span class="token operator">&lt;</span>code<span class="token operator">></span>src<span class="token operator">/</span>App<span class="token punctuation">.</span>js<span class="token operator">&lt;</span><span class="token operator">/</span>code<span class="token operator">></span> and save to reload<span class="token punctuation">.</span>\n        <span class="token operator">&lt;</span><span class="token operator">/</span>p<span class="token operator">></span>\n      <span class="token operator">&lt;</span><span class="token operator">/</span>div<span class="token operator">></span>\n    <span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>React is a library that makes use of Components, which let you split up your UI into independent, reusable pieces, and think about each piece in isolation.\nThere is already 1 component created, the <code>App</code> component. If you used the <code>create-react-app</code> tool, this component is the main component in the project and you should build around this central class.</p>\n<p>We will look at components more detailed in next chapters.</p>\n<h4>exports</h4>\n<p>When creating a class in react, you should export them after declaration, which allows you to use the component in another file by using the <code>import</code> keyword. You can use <code>default</code> after the <code>export</code> keyword to tell React that this is the main class of this file.</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token keyword">export</span> <span class="token keyword">default</span> App<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<h3>View the results!</h3>\n<p>When youâ€™ve started the development server by issuing the <code>npm start</code> command, you can view the changes you add to your project live in your browser. After issuing the command, npm should open a browser automatically displaying your app.</p>\n<h3>Sources</h3>\n<p><a href="https://reactjs.org/docs/hello-world.html">1. React documentation</a></p>',fields:{slug:"/react/your-first-app/"},frontmatter:{title:"Your first React App"}}},pathContext:{slug:"/react/your-first-app/"}}}});
